// C:\Users\Administrator\OneDrive\Documente\GitHub\salarizare\modern-backend\frontend\src\components\drivers\DriverForm.js
import React, { useState, useEffect } from 'react';
import FormInput from '../shared/forms/FormInput';
import Select from '../shared/forms/Select';
import Button from '../shared/buttons/Button';

const DriverForm = ({ driver, onSubmit }) => {
   const [formData, setFormData] = useState({
       nume: '',
       cnp: '',
       dataAngajare: '',
       dataNasterii: '',
       permisConducere: {
           serie: '',
           numar: '',
           dataExpirare: '',
           categorii: ['C', 'E']
       },
       contact: {
           telefon: '',
           email: '',
           adresa: ''
       },
       vehiculAsignat: '',
       status: 'Activ',
       documente: {
           contractMunca: '',
           fisMedical: {
               data: '',
               dataExpirare: ''
           },
           avizPsihologic: {
               data: '',
               dataExpirare: ''
           },
           atestatProfesional: {
               serie: '',
               numar: '',
               dataExpirare: ''
           },
           cardTahograf: {
               serie: '',
               dataExpirare: ''
           }
       },
       detaliiAmazon: {
           idSofer: '',
           zonaCurse: '',
           tipContract: '',
           diurnaZilnica: 70
       }
   });

   useEffect(() => {
       if (driver) {
           setFormData(driver);
       }
   }, [driver]);

   const handleSubmit = async (e) => {
       e.preventDefault();
       onSubmit(formData);
   };

   return (
       <form onSubmit={handleSubmit} className="space-y-6">
           {/* Date personale */}
           <div className="bg-white p-6 rounded-lg shadow">
               <h3 className="text-lg font-medium mb-4">Date Personale</h3>
               <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                   <FormInput
                       label="Nume Complet"
                       name="nume"
                       value={formData.nume}
                       onChange={(e) => setFormData({...formData, nume: e.target.value})}
                       required
                   />
                   <FormInput
                       label="CNP"
                       name="cnp"
                       value={formData.cnp}
                       onChange={(e) => setFormData({...formData, cnp: e.target.value})}
                       required
                   />
                   <FormInput
                       label="Data Angajării"
                       type="date"
                       name="dataAngajare"
                       value={formData.dataAngajare}
                       onChange={(e) => setFormData({...formData, dataAngajare: e.target.value})}
                       required
                   />
                   <FormInput
                       label="Data Nașterii"
                       type="date"
                       name="dataNasterii"
                       value={formData.dataNasterii}
                       onChange={(e) => setFormData({...formData, dataNasterii: e.target.value})}
                       required
                   />
               </div>
           </div>

           {/* Permis conducere */}
           <div className="bg-white p-6 rounded-lg shadow">
               <h3 className="text-lg font-medium mb-4">Permis Conducere</h3>
               <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                   <FormInput
                       label="Serie"
                       name="permisConducere.serie"
                       value={formData.permisConducere.serie}
                       onChange={(e) => setFormData({
                           ...formData,
                           permisConducere: {
                               ...formData.permisConducere,
                               serie: e.target.value
                           }
                       })}
                       required
                   />
                   <FormInput
                       label="Număr"
                       name="permisConducere.numar"
                       value={formData.permisConducere.numar}
                       onChange={(e) => setFormData({
                           ...formData,
                           permisConducere: {
                               ...formData.permisConducere,
                               numar: e.target.value
                           }
                       })}
                       required
                   />
                   <FormInput
                       label="Data Expirare"
                       type="date"
                       name="permisConducere.dataExpirare"
                       value={formData.permisConducere.dataExpirare}
                       onChange={(e) => setFormData({
                           ...formData,
                           permisConducere: {
                               ...formData.permisConducere,
                               dataExpirare: e.target.value
                           }
                       })}
                       required
                   />
               </div>
           </div>

           {/* Detalii Amazon */}
           <div className="bg-white p-6 rounded-lg shadow">
               <h3 className="text-lg font-medium mb-4">Detalii Amazon</h3>
               <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                   <FormInput
                       label="ID Șofer Amazon"
                       name="detaliiAmazon.idSofer"
                       value={formData.detaliiAmazon.idSofer}
                       onChange={(e) => setFormData({
                           ...formData,
                           detaliiAmazon: {
                               ...formData.detaliiAmazon,
                               idSofer: e.target.value
                           }
                       })}
                   />
                   <Select
                       label="Zonă Curse"
                       name="detaliiAmazon.zonaCurse"
                       value={formData.detaliiAmazon.zonaCurse}
                       onChange={(e) => setFormData({
                           ...formData,
                           detaliiAmazon: {
                               ...formData.detaliiAmazon,
                               zonaCurse: e.target.value
                           }
                       })}
                       options={[
                           { value: 'Germania', label: 'Germania' },
                           { value: 'Franta', label: 'Franța' },
                           { value: 'Benelux', label: 'Benelux' }
                       ]}
                   />
                   <FormInput
                       label="Diurnă Zilnică (EUR)"
                       type="number"
                       name="detaliiAmazon.diurnaZilnica"
                       value={formData.detaliiAmazon.diurnaZilnica}
                       onChange={(e) => setFormData({
                           ...formData,
                           detaliiAmazon: {
                               ...formData.detaliiAmazon,
                               diurnaZilnica: parseFloat(e.target.value)
                           }
                       })}
                       required
                   />
               </div>
           </div>

           <div className="flex justify-end">
               <Button type="submit" variant="primary">
                   {driver ? 'Actualizează' : 'Adaugă'} Șofer
               </Button>
           </div>
       </form>
   );
};

export default DriverForm;
